(21, 'Медиаредактор. Векторная графика', 'МВ_[Год обучения, Буква]', 'Курс \"Медиаредактор. Векторная графика\" рассчитан на детей от 12 до 18 лет, которые хотят научиться работать в различных графических редакторах, создавать, редактировать и настраивать векторные изображения. В процессе занятий ребенок познакомится с основными приемами векторной иллюстрации, изучит инструменты и принципы взаимодействия с готовыми векторными изображениями, научится реализовывать свои идеи, проявлять творческий потенциал, анализировать полученную информацию и грамотно ее использовать.', 'Принципы построения и работы с векторным изображением\r\nПриемы коррекции, трансформации и дистрибуции векторных изображений\r\nРабота с текстом в векторном формате\r\nСоздание векторных иллюстраций\r\nДизайн печатной продукции', 'Обзаведетесь интересным портфолио\r\nНаучитесь базовой обработке и ретуши изображений\r\nНаучитесь эффективному использованию ресурсов сети Интернет\r\nОвладеете умением профессионально презентовать свой проект\r\nВступите на увлекательный путь к профессии «Дизайнер»', 'Раздел 1. Adobe Illustrator', '1', '<b>Тема 1.1</b> Введение в компьютерную графику<br><b>Тема 1.2</b> Основы создания иллюстраций<br><b>Тема 1.3</b> Свет и тень в иллюстрациях<br><b>Тема 1.4</b> Изометрия<br><b>Тема 1.5</b> Работа с текстом<br><b>Тема 1.6</b> Создание фигур<br><b>Тема 1.7</b> Другие приемы иллюстрирования', 'media_icon.png', 'vector_image.jpg', 11, 17, 5000, 'мес.', '1 год', '3', '#DA4453', '#88216B'),
(22, 'Медиаредактор. Растровая графика', 'МР_[2, Буква]', 'Курс \"Медиаредактор. Растровая графика\" рассчитан на детей от 12 до 18 лет, которые хотят научиться работать в различных графических редакторах, создавать, редактировать и настраивать изображения. В процессе занятий ребенок научится ретушировать старые и новые фотографии, создавать коллажи, познакомится с основами цифрового рисунка, научится реализовывать свои идеи, проявлять творческий потенциал, анализировать полученную информацию и грамотно ее использовать.', 'Обработка и ретушь фотографий\r\nРабота с текстом в графических редакторах\r\nПриемы коррекции и трансформации растровых изображений\r\nСоздание растровых иллюстраций и коллажей', 'Обзаведетесь интересным портфолио\r\nНаучитесь базовой обработке и ретуши изображений\r\nНаучитесь эффективному использованию ресурсов сети Интернет\r\nОвладеете умением профессионально презентовать свой проект\r\nВступите на увлекательный путь к профессии «Дизайнер»', 'Раздел 1.Обработка растровых изображений \r\nРаздел 2. Создание цифрового изображения ', '1\r\n2', '<b>Тема 1.1</b> Введение в компьютерную графику<br><b>Тема 1.2</b> Цветокоррекция<br><b>Тема 1.3</b> Ретушь испорченного фото<br><b>Тема 1.4</b> Ретушь современной фотографии\r\n<b>Тема 2.1</b> Фотоманипуляции<br><b>Тема 2.2</b> Цветокоррекция<br><b>Тема 2.3</b> Коллажирование<br><b>Тема 2.4</b> Цифровой рисунок', 'media_icon.png', 'raster_image.jpg', 11, 17, 5000, 'мес.', '1 год', '3', '#316EB4', '#273067'),
(23, 'Медиаредактор. 3D-графика', 'М3_[Год обучения, Буква]', 'Курс \"Медиаредактор. 3D-графика\" рассчитан на детей от 12 до 18 лет, которые хотят научиться работать в различных графических редакторах, создавать, редактировать и настраивать трехмерные изображения. В процессе занятий ребенок научится моделировать простые и сложные трехмерные сцены и объекты, познакомится с принципами рендеринга и освещения, научится реализовывать свои идеи, проявлять творческий потенциал, анализировать полученную информацию и грамотно ее использовать.', 'Знакомство с основами и принципами работы и построения трехмерных изображений\r\nИзучение среды 3D редактора\r\nПараметрическое моделирование, деформеры\r\nСвет и тень, материалы и текстуры\r\nРендеринг\r\nАнимация и динамика', 'Обзаведетесь интересным портфолио\r\nНаучитесь базовой обработке и ретуши изображений\r\nНаучитесь эффективному использованию ресурсов сети Интернет\r\nОвладеете умением профессионально презентовать свой проект\r\nВступите на увлекательный путь к профессии «Дизайнер»', 'Раздел 1. Введение в Blender 2.8 \r\nРаздел 2. Работа с геометрией в Blender \r\nРаздел 3. Технологии \r\nРаздел 4. Свет и рендер ', '1\r\n2\r\n3\r\n4', '', 'media_icon.png', '3d_image.jpg', 12, 17, 5000, 'мес.', '1 год', '3', '#316EB4', '#273067'),
(24, 'Основы работы с персональным компьютером', 'ОР_[Год обучения, Буква]', 'Курс направлен на изучение основ компьютерной грамотности. Вы научитесь использовать файловую систему и офисное программное обеспечение, а также освоите безопасное использование интернета и создание надежных паролей.\r\n\r\nКурс подойдет для:\r\n\r\n- Пенсионеров\r\n- Тех, кто хочет удаленную работу\r\n- Тех, кто хочет усовершенствовать навыки работы с компьютером\r\n\r\nДля каждого обучающегося составляется индивидуальный план обучения, благодаря этому Вы экономите своё время и деньги.\r\n', 'Работа с файлами и папками\r\nЭлектронная почта\r\nИнтернет и браузер\r\nРабота с оргтехникой', 'Обзаведетесь интересным портфолио\r\nНаучитесь базовой обработке и ретуши изображений\r\nНаучитесь эффективному использованию ресурсов сети Интернет\r\nОвладеете умением профессионально презентовать свой проект\r\nВступите на увлекательный путь к профессии «Дизайнер»', '', '0', '', 'first_icon.png', 'source_image.png', NULL, NULL, 1000, '60мин.', '9 месяцев', '5', '#2C3E50', '#4CA1AF'),
(25, 'Pro.Office', 'ПО_[Год обучения, Буква]', 'Курс \"PRO.OFFICE\" рассчитан на взрослых от 18 лет, которые хотят научиться эффективной работе в пакете офисных приложений MS Office. В процессе изучения курса вы познакомитесь с такими программами как MS Word, MS Excel, MS PowerPoint, MS Outlook, MS Publisher и другими, которые могут пригодиться вам в вашей профессиональной деятельности. На наших занятиях мы руководствуемся спецификой Вашего запроса, подбирая программу обучения под Вас, поэтому Вы изучите ровно те программы и их функции, которые Вам необходимы.', 'Программных приложений пакета MS Office', 'Научитесь эффективно работать в необходимом вам программном обеспечении\r\nПовысите свой уровень профессионализма\r\nСможете выполнять рутинную работу в разы быстрее\r\nОбретете новые цифровые компетенции\r\nРасширите свои возможности при работе с персональным компьютером', '', '0', '', 'office_icon.png', 'office_image.png', NULL, NULL, 1000, '60мин.', '9 месяцев', '5', '#2C3E50', '#4CA1AF'),
(26, 'Бизнес-Excel', 'БЭ_[Год обучения, Буква]', 'Базовый уровень знания Excel нужен каждому специалисту организации. Однако, если говорить о профессиональном уровне пользования программой, то не стоит «кадровика» и «финансиста» обучать одинаково.\r\n\r\nК примеру, кадровику нужнее учет сроков аттестации и расчет предпенсионного возраста работников, в то время как финансисту важен анализ рентабельности производства и учет прибыли. Обе задачи успешно решаются при помощи использования инструментов Excel.\r\n\r\nПоэтому на наших занятиях мы руководствуемся спецификой Вашего запроса, подбирая программу обучения под Вас.\r\n\r\nПреподаватели проводят курс <Бизнес Excel> НЕ с помощью многотомника «Эксель для чайников». Наша команда, используя многолетнюю практику работы с большими массивами данных и решения различных нетиповых задач в Excel, составила уникальную программу обучения, которая подойдет именно Вашей организации.\r\n\r\nПроцесс обучения строится не на теоретических задачах, взятых из учебника, а непосредственно внедряется в Ваши бизнес-процессы, ускоряя и структурируя ежедневную монотонную работу, позволяя сократить время на обработку анализ информации.\r\n', 'Изучение основ работы в Microsoft Excel\r\nАвтоматизация расчетов в Microsoft Excel\r\nОбучение анализу большого массива данных', 'Получите «черный пояс» по Excel\r\nНаучитесь анализировать большой массив информации\r\nПрекратите корпеть над отчетами\r\nПолучите свидетельство об окончании курсов\r\nПовысите уровень профессионализма', '', '0', '', 'microsoft-excel.png', 'excel.jpg', NULL, NULL, 1000, '60мин.', '9 месяцев', '5', '#2C3E50', '#4CA1AF'),
(27, '3D Моделирование для детей', 'МД_[Год обучения, Буква]', '3D-моделирование - это процесс создания трехмерной модели какого-либо объекта (как реального, так и абстрактного). Курс 3d моделирования для детей - это сочетание математики, геометрии и дизайна, направленное на развитие вашего ребенка.\r\n\r\n3D-моделирование прочно вошло в нашу современную жизнь и применяется во многих отраслях: 3D визуализация зданий, создание моделей персонажей, создание 3D моделей предметов интерьера, реклама и маркетинг, изготовление эксклюзивных украшений, производство мебели и комплектующих, промышленная и медицинская сфера\r\n\r\nTinkerCAD - программа для начинающих. В ней простой и понятный интерфейс, с помощью которого можно освоить все базовые навыки создания объектов.', 'Знакомство с геометрическими фигурами\r\nОсновы навыков черчения и создание фигур в пространстве\r\nВведение в примитивные формы\r\nОсновы математических навыков\r\nВведение в программирование', 'Обзаведется интересным портфолио\r\nПриобретет навыков использования инструментов 3D моделирования\r\nНаучитесь эффективному использованию ресурсов сети Интернет\r\nОвладеете умением профессионально презентовать свой проект\r\nВступите на увлекательный путь к профессии «3D-дизайнер» ', 'Раздел 1. Введение в программирование\r\nРаздел 2. Основы навыков черчения и создание фигур в пространстве. Введение в примитивные формы\r\nРаздел 3. Создание собственного аватара. Основы математических навыков\r\nРаздел 4. Базовое знакомство с блоками программирования\r\nРаздел 5. Дизайн биомного террариума\r\nРаздел 6. Введение в программирование. Знакомство с блоками\r\nРаздел 7. Итоговый проект', '1\r\n2\r\n3\r\n4\r\n5\r\n6\r\n7', '\r\n', '3dchild_icons.png', '3dchild_image.jpg', 8, 11, 2500, 'мес.', '1 год', '2', '#00B3DB', '#0082B0'),
(29, 'Unity.GameDev. Уровень 2', 'ЮН [2, Буква]', 'нет данных', '', '', '', '0', '', '', '', NULL, NULL, 0, '', '0', '10', '#316EB4', '#273067'),
(31, 'ОГЭ Обществознание', 'ОГЭ. О [1, Буква]', 'нет данных', '', '', '', '0', '', '', 'society_image.jpg', NULL, NULL, 2400, 'мес.', '0', '4', '#F3E748', '#6DB42D'),
(32, 'Цифровой Художник', 'ЦХ [Год, Буква]', 'Цифровой художник - это курс на стыке двух профессий: Художника и дизайнера.\r\n\r\nЗа 4 учебных года мы усовершенствовали наши курсы, связанные с графическими редакторами много раз, и пришли к мысли, что курсы должны захватывать еще больше компетенций и навыков. Один из таких навыков - это навык традиционного (академического) рисунка.\r\n\r\nСовершенно невозможно представить себе Дизайнера, Модельера или Архитектора, который не умеет рисовать, который не знает правил перспективы, падения и отражения света, который не умеет работать с цветом и тоном.\r\n\r\nПоэтому в наших стенах появился курс, который научит ребят не только пользоваться персональным компьютером для создания творческих проектов, но и разовьет в них навыки работы с бумагой, карандашами и красками и понимание принципов построения рисунка.\r\n\r\nНа занятиях школьники будут работать как над развитием навыков и знаний в области академического рисунка и живописи, так и над навыками работы в программных средствах для создания цифровых изображений.', 'Рисовать объекты в перспективе\r\nСоздавать свето-теневой рисунок\r\nСоставлять композицию\r\nПодбирать цвета для иллюстраций\r\nРаботать в различных графических программах\r\nСтилизовать персонажей и окружение\r\nПодготавливать изображение к печати', 'Откроете новые возможности детям при работе с компьютером\r\nПовысите успеваемость ребенка\r\nВыработаете навыки творческого мышления\r\nСформируете у ребенка стремление познакомиться с миром IT-технологий\r\nРазовьете интеллектуальные способности ребенка', '', '0', '', 'CH_icon.png', 'ch_image.jpg', 11, 17, 5000, 'мес.', '1 год', '3', '#DA4453', '#88216B'),
(33, 'IT-английский 7-11', 'ИТА_[год, буква]', 'В наше время без английского языка никуда, язык является самым распространённым в мире. Документация, описания технологий и огромный пласт обучающей информации в зарубежном интернете – все это на английском. Изучение иностранных языков лучше всего начинать с раннего возраста. На данном этапе развития ребятам важен процесс формирования личности, что невозможно без взаимодействия со сверстниками.\r\n\r\nНаш курс будет полезен будущим программистам, web-разработчикам и аналитикам. Благодаря нему ваш ребенок научится изучать материалы иностранном языке, смотреть и изучать материалы на интересующие их темы.\r\n\r\nНа наших занятиях дети и подростки развивают логическое мышление и анализируют поступающую информацию, учатся примерять на себя разные роли в рамках темы урока.', 'Пополнит словарный запас на различные темы\r\nПравильно произносить английские слова и предложения\r\nУсовершенствует грамматические навыки\r\nРассказывать о себе, своих увлечениях, предпочтениях, говорить на простые темы\r\nПисать небольшие тексты, письма\r\nЧитать и понимать адаптированную литературу своего уровня', '', '', '0', '', 'iteng_icon.png', 'iteng_kids_image.jpg', 7, 11, 2500, 'мес.', '9 месяцов', '2', '#DA4453', '#88216B'),
(34, 'Медиаредактор. Видео', 'МВ [Год обучения. Буква]', 'Видеордактор превращает отдельные кадры в цельное произведение. Он не просто склеивает удачные сцены в ленту, а рассказывает историю с помощью средств монтажа. Благодаря его работе фильмы, реклама, клипы и ролики для соцсетей обретают финальный вид. С помощью нашего курса ваш ребенок научится профессионально монтировать клипы, фильмы, рекламные ролики и репортажи. Благодаря нему он найдет свой стиль и сможет начать карьеру в видеопродакшене или делать крутые проекты в соцсетях и на YouTube.', 'Вы научитесь работать с видео от идеи до релиза\r\nОсвоите профессиональные программы для монтажа, цветокоррекции, создания эффектов и саунд-дизайна\r\nНаучитесь профессионально монтировать клипы, фильмы, рекламные ролики и репортажи.', '', '', '0', '', 'm_video_icon.png', 'm_video_image.jpg', 11, 17, 5000, 'мес.', '9 месяцов', '3', '#DA4453', '#88216B'),
(35, 'Медиаредактор. Музыка', 'ММ [Год обучения, Буква]', 'Медиаредактор. Музыка - это совершенно новый курс, целью которого является знакомство школьников с понятием и методами создания цифровых музыкальных треков. Есть мнение, что для цифровых музыкантов нужно много оборудования, отдельная студия и т.д., но наш курс доказывает, что для старта в эту сферу достаточно компьютера и мышки ', 'Нарезать музыкальные произведения по партиям\r\nРедактировать тональность\r\nПисать драм-партии\r\nСводить ударные и мелодию\r\nРаботать с лидами и дропами\r\nПисать собственные музыкальные треки\r\nРаботать в программе DAW FL Studio', '', '', '0', '', 'music_icon.png', 'music_image.jpg', 11, 17, 5000, 'мес.', '9 месяцов', '3', '#DA4453', '#88216B'),
(36, 'ОГЭ, ЕГЭ Информатика', '', 'Курс подготовки к ЕГЭ по информатике рассчитан на учащихся 10 – 11 классов. Помимо данного курса мы предлагаем курсы подготовки к ОГЭ по информатике для учащихся 9 классов. Для ребят 7 – 8 классов, которые уже сейчас задумываются над тем, чтобы выбрать экзамен по информатике в старших классах, мы рекомендуем не откладывать дело в долгий ящик, и приступить к изучению данного курса уже сейчас.', '', 'Сформируете навыки комплексного применения знаний по информатике\r\nПодготовитесь к сдаче Единого государственного экзамена по информатике\r\nОтработаете навыки работы с тестами\r\nОвладеете фундаментальными знаниями по курсу информатики и ИКТ', '', '0', '', 'ege_icon.png', 'ege-inf.jpg', 15, 18, 2400, 'мес.', '9 месяцов', '4', '#DA4453', '#88216B'),
(37, 'ОГЭ, ЕГЭ Математика', '', 'нет данных', '', '', '', '0', '', 'ege_icon.png', 'math_image.jpg', NULL, NULL, 2400, 'мес.', '', '4', '#DA4453', '#88216B'),
(38, 'IT-английский 12-17', 'ИТА_[год, буква] нужно уточнение', 'В наше время без английского языка никуда, язык является самым распространённым в мире. Документация, описания технологий и огромный пласт обучающей информации в зарубежном интернете – все это на английском. Изучение иностранных языков лучше всего начинать с раннего возраста. На данном этапе развития ребятам важен процесс формирования личности, что невозможно без взаимодействия со сверстниками.\r\n\r\nНаш курс будет полезен будущим программистам, web-разработчикам и аналитикам. Благодаря нему ваш ребенок научится изучать материалы иностранном языке, смотреть и изучать материалы на интересующие их темы.\r\n\r\nНа наших занятиях дети и подростки развивают логическое мышление и анализируют поступающую информацию, учатся примерять на себя разные роли в рамках темы урока.', 'Пополнит словарный запас на различные темы\r\nПравильно произносить английские слова и предложения\r\nУсовершенствует грамматические навыки\r\nРассказывать о себе, своих увлечениях, предпочтениях, говорить на простые темы\r\nПисать небольшие тексты, письма\r\nЧитать и понимать адаптированную литературу своего уровня', '', '', '0', '', 'iteng_icon.png', 'iteng_kids_image.jpg', 12, 17, 5000, 'мес.', '9 месяцов', '3', '#DA4453', '#88216B'),
(39, 'ОГЭ, ЕГЭ Английский', '', 'Курс подготовки к ЕГЭ по английскому рассчитан на учащихся 10 – 11 классов. Помимо данного курса мы предлагаем курсы подготовки к ОГЭ по английскому для учащихся 9 классов. Для ребят 7 – 8 классов, которые уже сейчас задумываются над тем, чтобы выбрать экзамен по английскому в старших классах, мы рекомендуем не откладывать дело в долгий ящик, и приступить к изучению данного курса уже сейчас.', '', '', '', '0', '', 'ege_icon.png', 'en_image.jpg', NULL, NULL, 2400, 'мес.', '1 год', '4', '#DA4453', '#88216B'),
(42, 'Unity. GameDev.', '', 'Если ты хотел стать крутым кодером, чтобы делать не менее крутые игры, от которых будут фанатеть даже сотрудники Blizzard и Valve, но не знаешь с чего начать, то этот курс для тебя! Мы расскажем об основных принципах gamedev’a, научим работе в популярной межплатформенной среде разработки компьютерных игр Unity, известной такими проектами как Hearthstone, Subnautica, Pokemon GO, Warhammer 40000 и многие другие, а также поможем создать твой первый полноценный игровой проект (возможно, даже не один). Этот курс будет полезен как для новичков в программировании, так и для тех, кто уже знает разницу между объектно-ориентированным (ООП) и процедурным программированием.', 'Разработки приложений в редакторе Unity\r\nОсновы программирования на языке программирования C#\r\nРабота с анимацией\r\nДизайн уровней\r\nРазработка GUI', 'Поймете основные принципы ООП\r\nНаучитесь работать в команде\r\nПолучите черный пояс по гуглу\r\nСделаете свою первую игру\r\nВторую игру тоже сделаете', 'Раздел 1. Введение в game development', '1', '<b>Тема 1.1</b> Знакомство с интерфейсом Unity3D<br><b>Тема 1.2</b> Введение в программирование<br><b>Тема 1.3</b> Создание главного героя<br><b>Тема 1.4</b> Враги, жизни, проигрыш<br><b>Тема 1.5</b> Создание элементов окружение<br><b>Тема 1.6</b> Дизайн уровней<br><b>Тема 1.7</b> Введение в UI<br><b>Тема 1.8</b> Работа со временем<br><b>Тема 1.9</b> Магазин предметов в игре<br><b>Тема 1.10</b> Звук<br><b>Тема 1.11</b> Портирование под Android<br>', 'unity_icon.png', 'unity_image.jpg', 11, 18, 5000, 'мес.', '2 года', '3', '', ''),
(43, 'Веб-разработчик', '', 'Курс направлен на освоение профессии веб-разработчик (разработка веб-сайтов и веб-приложений).\r\n\r\nПопулярность профессии веб-разработчика с каждым годом возрастает в среднем на 15–20% во всех уголках мира. Это ремесло хоть и достаточно сложное в изучении, однако, имеет массу преимуществ по сравнению с другими.\r\n\r\nWeb-разработчик — это тот, кто создаёт сайты, сервисы и веб-приложения, которыми мы пользуемся ежедневно.\r\n\r\nВ профессии веб-разработчика есть три больших специализации:\r\n\r\n- Frontend-разработчик — создаёт интерфейс, видимую часть приложения. Такой специалист должен:\r\n\r\n    знать HTML, CSS, JavaScript;\r\n    создавать интерфейсы в Angular, Vue, React;\r\n    разбираться в препроцессорах CSS;\r\n    понимать, как устроен протокол HTTP.\r\n\r\n- Backend-разработчик — отвечает за внутренности, серверную часть сайта. Такой специалист должен:\r\nзнать язык программирования (PHP, Python, Ruby, Java, Perl, C#, JavaScript);\r\nразбираться во фреймворках под нужный язык (Django для Python; Laravel, Yii2 для PHP;Node.js для JavaScript);\r\nпонимать, как устроены базы данных и как из них достать информацию с помощью SQL.\r\n- Fullstack-разработчик — специалист, который отвечает за frontend и backend разработку.\r\n\r\nК достоинствам профессии можно отнести постоянный спрос на предлагаемую услугу, возможность работы с клиентами со всего мира, профессиональный рост зависит исключительно от навыков и личного уровня развития, возможность работать удаленно, отсутствие финансовых затрат для выполнения практически любого проекта, достойный уровень заработной платы.\r\n\r\nПрограмма предполагает практическое выполнение заданий, а также выполнение итоговой аттестационной работы по изучаемой программе.\r\n\r\nОтличительной особенностью программы является то, что в процессе ее реализации формируются все необходимые навыки для овладения основами Web-разработки. Содержание программы способствует формированию у обучающихся творческих способностей, а также развитию компетенций, необходимых в обществе, использующем современные информационные технологии.', 'Основы HTML\nОсновы CSS\nВерстка сайтов\nАдаптивность и кроссбраузерность\nОсновы JavaScript\nУстройство интернета. Хостинг', 'Обзаведетесь интересным портфолио\r\nСоздадите свой собственный сайт, и не один\r\nОтвыкните от стереотипного мышления\r\nОвладеете умением профессионально презентовать свой проект\r\nВступите на увлекательный путь к профессии «web-программист»', 'Раздел 1. Frontend разработка\r\nРаздел 2. Backend-разработка\r\nРаздел 3. Профессиональная разработка\r\nРаздел 4. Fullstack разработчик JavaScript\r\nРаздел 5. Разработчик PHP', '1\r\n2\r\n3\r\n4\r\n5', '<b>Тема 1.1</b> Основы HTML<br><b>Тема 1.2</b> Основы CSS<br><b>Тема 1.3</b> Практический модуль. Верстка сайта по графическому макету<br><b>Тема 1.4</b> Адаптивность и кроссбраузерность<br><b>Тема 1.5</b> Основы JavaScript<br><b>Тема 1.6</b> Практика JavaScript<br><b>Тема 1.7</b> Устройство интернета. Хостинг<br><b>Тема 1.8</b> Итоговый проект\r\n<b>Тема 2.1</b> Основы PHP<br><b>Тема 2.2</b> Основы БД<br><b>Тема 2.3</b> MySQL и PHP<br><b>Тема 2.4</b> Практика MySQL и PHP<br><b>Тема 2.5</b> Итоговый проект\r\n<b>Тема 3.1</b> Профессиональный CSS<br><b>Тема 3.2</b> Профессиональный JavaScript<br><b>Тема 3.3</b> Профессиональный PHP\r\n<b>Тема 4.1</b> Vue<br><b>Тема 4.2</b> React<br><b>Тема 4.3</b> Node\r\n<b>Тема 5.1</b> Laravel <br><b>Тема 5.2</b> YII ', 'web_icon.png', 'web1_image.jpg', 11, 17, 5000, 'мес.', '1 год', '3', '', '');
INSERT INTO `courses` (`id`, `namecourse`, `abbreviation`, `description`, `top_theses`, `bottom_theses`, `sections`, `number`, `subsections`, `icon`, `img`, `age_min`, `age_max`, `cost`, `cost_unit`, `time`, `id_courses_categories`, `color1`, `color2`) VALUES
(48, 'Программирование. Python', 'ПП_[Год обучения, Буква]', 'Python – мощный высокоуровневый язык программирования, идеально подходящий для разработки самостоятельных программ и сценариев. Python используют такие гиганты, как Google, Intel, Cisco и Hewlett-Packard, на нем работают популярные площадки YouTube, «ВКонтакте», DropBox.\r\n\r\nPython – язык программирования, который будет востребован еще очень долго, поскольку его отличает простой и доступный синтаксис, благодаря которому писать код гораздо легче, чем на C# или Java.\r\n\r\nРазработчики на Python ценят красоту и ясность кода, что нашло отражение в их философии под названием «Дзен Питона». «Особые случаи не настолько особые, чтобы нарушать правила», «Красивое лучше, чем уродливое… Простое лучше, чем сложное» – вот некоторые выдержки этой философии.\r\n\r\nБогатая библиотека модулей, возможность выбрать интерактивный или скриптовый режим, меньший объем вводимого кода и, как следствие, более высокая скорость разработки – вот почему Python имеет миллионы поклонников по всему миру.\r\n\r\nЭтот язык, пожалуй, можно назвать лучшим вариантом для знакомства с программированием. Освоить Python под силу любому новичку, желающему разобраться в основах программирования.', 'Основы алгоритмизации и логики\r\nОсновы и методы программирования на языке Python\r\nРешение олимпиадных задач\r\nОбъектно-ориентированное программирование', 'Напишете свою первую программу\r\nОсвоите первую ступень мира программирования\r\nУсвоите базовые понятия языка программирования\r\nПознакомитесь с азами объектно-ориентированного программирования\r\nНаучитесь использовать компьютер не только для «поиграть» ', 'Раздел 1. Основы программирования на языке Python\r\nРаздел 2. Методы программирования на языке Python', '1\r\n2', '<b class=\"course-module__points--bold\">Тема 1.1</b>Операторы. Переменные. Типы данных. Условия<br><b class=\"course-module__points--bold\">Тема 1.2</b> Циклы. Строки. Списки<br><b class=\"course-module__points--bold\">Тема 1.3</b>Функции. Словари. Интерпретатор. Файлы. Модули. \r\n<b class=\"course-module__points--bold\">Тема 2.1</b>Методы программирования на языке Python. Решение олимпиадных задач.<br><b class=\"course-module__points--bold\">Тема 2.2</b>Объектно-ориентированное программирование. Решение задач повышенной сложности<br><b class=\"course-module__points--bold\">Тема 2.3</b>Модуль graph.py', 'source_icon.png', 'python_image.jpg', NULL, NULL, 1000, '60мин.', '2 года', '5', '#DA4453', '#88216B'),
(49, 'Дизайн интерфейсов', 'ДИ_[Год обучения, Буква]', 'Курс \"Дизайн интерфейсов\" рассчитан на детей от 12 до 18 лет, которые хотят научиться создавать современные и востребованные дизайны веб-сайтов, мобильных приложений. В процессе занятий ребенок познакомится с основными принципами дизайна, строения интерфейса и применения цветов в дизайне, научится реализовывать свои идеи, проявлять творческий потенциал, анализировать полученную информацию и грамотно ее использовать.', 'Знакомство с правилами построения пользовательского интерфейса\r\nИзучение основных законов цвета и формы\r\nИзучение инструментария дизайнера (Графические редакторы)\r\nЗнакомство со средой Figma\r\nИзучение основ верстки (HTML, CSS)', 'Обзаведетесь интересным портфолио\r\nНаучитесь базовой обработке и ретуши изображений\r\nНаучитесь эффективному использованию ресурсов сети Интернет\r\nОвладеете умением профессионально презентовать свой проект\r\nВступите на увлекательный путь к профессии «Дизайнер»', 'Раздел 1.Графические редакторы \r\nРаздел 2. Цвет и типографика \r\nРаздел 3. Макетирование \r\nРаздел 4. Итоговый проект ', '1\r\n2\r\n3\r\n4', '<b>Тема 1.1</b> Фотошоп<br><b>Тема 1.2</b> Иллюстратор<br><b>Тема 1.3</b> Фигма\r\n<b>Тема 2.1</b> Искусство цвета<br><b>Тема 2.2</b> Шрифт и его использование в дизайне\r\n<b>Тема 3.1</b> Лэндинг<br><b>Тема 3.2</b> Многостраничник<br><b>Тема 3.3</b> Мобильное приложение', 'media_icon.png', 'ux_image.jpg', NULL, NULL, 1000, '60мин.', '1 год', '5', '#316EB4', '#273067'),
(50, 'Медиаредактор. Векторная графика', 'МВ_[Год обучения, Буква]', 'Курс \"Медиаредактор. Векторная графика\" рассчитан на детей от 12 до 18 лет, которые хотят научиться работать в различных графических редакторах, создавать, редактировать и настраивать векторные изображения. В процессе занятий ребенок познакомится с основными приемами векторной иллюстрации, изучит инструменты и принципы взаимодействия с готовыми векторными изображениями, научится реализовывать свои идеи, проявлять творческий потенциал, анализировать полученную информацию и грамотно ее использовать.', 'Принципы построения и работы с векторным изображением\r\nПриемы коррекции, трансформации и дистрибуции векторных изображений\r\nРабота с текстом в векторном формате\r\nСоздание векторных иллюстраций\r\nДизайн печатной продукции', 'Обзаведетесь интересным портфолио\r\nНаучитесь базовой обработке и ретуши изображений\r\nНаучитесь эффективному использованию ресурсов сети Интернет\r\nОвладеете умением профессионально презентовать свой проект\r\nВступите на увлекательный путь к профессии «Дизайнер»', 'Раздел 1. Adobe Illustrator', '1', '<b>Тема 1.1</b> Введение в компьютерную графику<br><b>Тема 1.2</b> Основы создания иллюстраций<br><b>Тема 1.3</b> Свет и тень в иллюстрациях<br><b>Тема 1.4</b> Изометрия<br><b>Тема 1.5</b> Работа с текстом<br><b>Тема 1.6</b> Создание фигур<br><b>Тема 1.7</b> Другие приемы иллюстрирования', 'media_icon.png', 'vector_image.jpg', NULL, NULL, 1000, '60мин.', '1 год', '5', '#DA4453', '#88216B'),
(51, 'NoКодер. Разработка без кода', 'НК_[Год обучения, Буква]', 'No-Code - совсем новое направление в разработке IT-продуктов, которое только набирает популярность. За последние годы эта концепция стала одной из самых трендовых на технологическом рынке.\r\n\r\nNo-code - это метод создания IT-продуктов, не требующий знаний в области программирования, освоит даже гуманитарий. No-code-инструменты позволяют обычным пользователям ПК создавать веб-сайты и приложения без необходимости написания программного кода.\r\n\r\nИспользуя такие инструменты, можно автоматизировать задачи, которые приходится решать на работе или дома, можно организовывать данные, создавать проекты на заказ и получать за это деньги. Например, когда создается опрос в интернете - это тоже no-code-инструменты.\r\n\r\nК достоинствам профессии можно отнести постоянный спрос на предлагаемую услугу, возможность работы с клиентами со всего мира, профессиональный рост зависит исключительно от навыков и личного уровня развития, возможность работать удаленно, отсутствие финансовых затрат для выполнения практически любого проекта, достойный уровень заработной платы.\r\n\r\nПроцесс создания таких приложений творческий и увлекательный, поэтому данный курс будет интересен обучающимся не только в получении новых знаний и умений, но и в выборе их будущей профессиональной деятельности.', 'Разработка сайтов\r\nРазработка чат-ботов\r\nРазработка мобильного приложения\r\nРазработка веб-сервиса', 'Откроете новые возможности детям при работе с компьютером\r\nПовысите успеваемость ребенка\r\nВыработаете навыки творческого мышления\r\nСформируете у ребенка стремление познакомиться с миром IT-технологий\r\nРазовьете интеллектуальные способности ребенка', 'Раздел 1.Разработка сайтов на Tilda \r\nРаздел 2. Разработка чат-ботов\r\nРаздел 3. Разработка мобильного приложения\r\nРаздел 4. Разработка веб-сервиса\r\nРаздел 5. Итоговый проект', '1\r\n2\r\n3\r\n4\r\n5', '<b>Тема 1.1</b> Знакомство с профессией. Подготовка к разработке сайта<br><b>Тема 1.2</b> Разработка Landing Page<br><b>Тема 1.3</b> Разработка интернет-магазина<br><b>Тема 1.4</b> Продвинутые функции Тильды\r\n<b>Тема 2.1</b> Введение в разработку чат-ботов. Создание чат-бота для сайта<br><b>Тема 2.2</b> Разработка чат-бота для Telegram<br><b>Тема 2.3</b> Разработка чат-бота для ВКонтакте\r\n<b>Тема 3.1</b> Основы мобильной разработки<br><b>Тема 3.2</b> Создание приложения для интернет-магазина<br><b>Тема 3.3</b> Создание обучающего приложения\r\n<b>Тема 4.1</b> Разработка социальной сети\r\n<b>Тема 5.1</b> Выполнение итогового проекта<br><b>Тема 5.2</b> Защита итогового проекта', 'nocode_icon.png', 'nocode_image.jpg', NULL, NULL, 1000, '60мин.', '1 год', '5', '#DA4453', '#88216B'),
(52, 'Медиаредактор. 3D-графика', 'М3_[Год обучения, Буква]', 'Курс \"Медиаредактор. 3D-графика\" рассчитан на детей от 12 до 18 лет, которые хотят научиться работать в различных графических редакторах, создавать, редактировать и настраивать трехмерные изображения. В процессе занятий ребенок научится моделировать простые и сложные трехмерные сцены и объекты, познакомится с принципами рендеринга и освещения, научится реализовывать свои идеи, проявлять творческий потенциал, анализировать полученную информацию и грамотно ее использовать.', 'Знакомство с основами и принципами работы и построения трехмерных изображений\r\nИзучение среды 3D редактора\r\nПараметрическое моделирование, деформеры\r\nСвет и тень, материалы и текстуры\r\nРендеринг\r\nАнимация и динамика', 'Обзаведетесь интересным портфолио\r\nНаучитесь базовой обработке и ретуши изображений\r\nНаучитесь эффективному использованию ресурсов сети Интернет\r\nОвладеете умением профессионально презентовать свой проект\r\nВступите на увлекательный путь к профессии «Дизайнер»', 'Раздел 1. Введение в Blender 2.8 \r\nРаздел 2. Работа с геометрией в Blender \r\nРаздел 3. Технологии \r\nРаздел 4. Свет и рендер ', '1\r\n2\r\n3\r\n4', '', 'media_icon.png', '3d_image.jpg', NULL, NULL, 1000, '60мин.', '1 год', '5', '#316EB4', '#273067'),
(53, 'Медиаредактор. Растровая графика', 'МР_[2, Буква]', 'Курс \"Медиаредактор. Растровая графика\" рассчитан на детей от 12 до 18 лет, которые хотят научиться работать в различных графических редакторах, создавать, редактировать и настраивать изображения. В процессе занятий ребенок научится ретушировать старые и новые фотографии, создавать коллажи, познакомится с основами цифрового рисунка, научится реализовывать свои идеи, проявлять творческий потенциал, анализировать полученную информацию и грамотно ее использовать.', 'Обработка и ретушь фотографий\r\nРабота с текстом в графических редакторах\r\nПриемы коррекции и трансформации растровых изображений\r\nСоздание растровых иллюстраций и коллажей', 'Обзаведетесь интересным портфолио\r\nНаучитесь базовой обработке и ретуши изображений\r\nНаучитесь эффективному использованию ресурсов сети Интернет\r\nОвладеете умением профессионально презентовать свой проект\r\nВступите на увлекательный путь к профессии «Дизайнер»', 'Раздел 1.Обработка растровых изображений \r\nРаздел 2. Создание цифрового изображения ', '1\r\n2', '<b>Тема 1.1</b> Введение в компьютерную графику<br><b>Тема 1.2</b> Цветокоррекция<br><b>Тема 1.3</b> Ретушь испорченного фото<br><b>Тема 1.4</b> Ретушь современной фотографии\r\n<b>Тема 2.1</b> Фотоманипуляции<br><b>Тема 2.2</b> Цветокоррекция<br><b>Тема 2.3</b> Коллажирование<br><b>Тема 2.4</b> Цифровой рисунок', 'media_icon.png', 'raster_image.jpg', NULL, NULL, 1000, '60мин.', '1 год', '5', '#316EB4', '#273067'),
(54, 'Медиаредактор. Моушн-дизайн', 'МР_[1, Буква]', 'Курс \"Медиаредактор. Моушн-дизайн\" рассчитан на детей от 12 до 18 лет, которые хотят научиться работать в различных графических редакторах, создавать, редактировать и настраивать анимационные ролики. В процессе занятий ребенок научится познакомится с базовыми принципами анимирования векторных объектов, научится реализовывать свои идеи, проявлять творческий потенциал, анализировать полученную информацию и грамотно ее использоват', 'Шейповая анимация и переходы\r\nАнимирование HUD/UI интерфейсов\r\nРиггинг персонажей\r\nКорпоративная графика\r\nЦветокоррекция и грейдинг\r\nОсновы кеинга, трекинга, матчмувинга и стабилизации', 'Обзаведетесь интересным портфолио\r\nНаучитесь базовой обработке и ретуши изображений\r\nНаучитесь эффективному использованию ресурсов сети Интернет\r\nОвладеете умением профессионально презентовать свой проект\r\nВступите на увлекательный путь к профессии «Дизайнер»', 'Раздел 1. Основы дизайна \r\nРаздел 2. After Effects \r\nРаздел 3. Создание анимации персонажей ', '1\r\n2\r\n3', '', 'media_icon.png', 'motion_image.jpg', NULL, NULL, 1000, '60мин.', '1 год', '5', '#DA4453', '#88216B');
